import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import './css/all.min.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import Banner from './components/Banner';

function App() {
  return (
    <div className="App">
      <Header />
      <Banner />
      <Footer />
    </div>
  );
}

export default App;
